taskSetItem.script2:
var token = eio.readString8();
var searchText = eio.readString8();
var pageSize = eio.readInt32();
var pageCurrent = eio.readInt32();

var sql,sqlResult;
sql = "exec getUserInfoBySession '" + db.encode(token) + "'";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
db.read(sqlResult);
if (db.getString(sqlResult, "sessionId").length < 5) {
    eio.appendString8("F");
    eio.appendString8("token失效");
    es.logWarning("用户token失效, sql=" + sql);
    return;
}   
var userId = db.getString(sqlResult, "id");
var companyId = db.getString(sqlResult, "companyId");

//获取记录数量
var condition = "";
if (searchText != "") {
    condition +=
        " and (" +
        "(dbo.log.note like '%" + db.encode(searchText) + "%')) ";
}

sql =
    "SELECT count(*) as c " +
    "FROM dbo.[log] INNER JOIN " +
    "      dbo.userInfo ON dbo.[log].userId = dbo.userInfo.id " +
    "WHERE (dbo.userInfo.companyId = " + companyId + ") " + condition;
sqlResult = db.executeQuery("DB", sql);   
db.read(sqlResult);
var count = db.getInt32(sqlResult, "c");

sql= 
    "SELECT dbo.[log].id, dbo.[log].regDatetime, dbo.userInfo.userName, " +
    "      dbo.userInfo.nickName, dbo.[log].logType, dbo.[log].logSubType, dbo.[log].note " +
    "FROM dbo.[log] INNER JOIN " +
    "      dbo.userInfo ON dbo.[log].userId = dbo.userInfo.id " +
    "WHERE (dbo.userInfo.companyId = " + companyId + ") " + condition +
    "ORDER BY dbo.log.id DESC ";
sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}
eio.appendString8("T");
eio.appendInt32(count);
eio.appendDataSet(sqlResult,"id,regDatetime,userName,nickName,logType,logSubType,note", pageSize*(pageCurrent-1), pageSize);

taskSetItem.script3:
if (eio.readString8() != "T") {
    alert("无法获取您需要的数据：" + eio.readString8());
    return;
}
g5.pageRecordCount = eio.readInt32();
g5.dataset1 = eio.readDataSet();
g5.user = eio.readString8();
g5.pageCount = parseInt((g5.pageRecordCount-1)/g5.pageSize)+1;
ee.setTableData(ee.getControl("tablebody2"), g5.dataset1,0);   
ee.setText(ee.getControl("layoutxitem45"), g5.pageCurrent + "/" + g5.pageCount);
ee.setText(ee.getControl("panel16"), "共找到" +
    "<font color = '#d00000'>" + g5.pageRecordCount + "条</font>记录");
